def get_non_scientific_name (name):
    '''
    Purpose: Takes a name and parses
    '''

    non_scientific_name = ''
    for i in range(len(name)):
        if name[i] == '(':
            j = i+1
            while name[j] != ')':
                j += 1
            non_scientific_name = name[i+1:j]

    return non_scientific_name.strip()




def get_size (name):
    '''

    '''

    size = ''
    name = name.strip('"')
    words = name.split()
    for i in range(len(words)):
        
        if words[i].lower().endswith('gal'):
            if words[i][:-3] == '':
                size = str(words[i-1]) + 'gal'
            else:
                size = str(words[i])

            return size[:-3] + ' gallon'

        elif words[i].lower().endswith('box'):
            if words[i][:-3] == '':
                size = str(words[i-1]) + 'box'
            else:
                size = str(words[i])

            return (size[:-3] + ' box').replace('"', '', 1)
        

    return 'N/A'



def get_price (price):
    '''

    '''

    price = price

    if '.' in price:
        if price[-2] == '.':
            return price + '0'
        else:
            return price

    return price + '.00'




